  PRIMARY KEY (`MENU_ID`) USING BTREE,
  UNIQUE KEY `PARENT_ID` (`PARENT_ID`,`MENU_NAME`) USING BTREE,
  KEY `MENU_NAME` (`MENU_NAME`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=160 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

