#
# Structure for table "user"
#

CREATE TABLE `user` (
  `user_id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `openid` varchar(64) NOT NULL DEFAULT '',
  `type` tinyint(3) unsigned DEFAULT '0' COMMENT '用户类型 0：用户 1：师傅',
  `user_name` varchar(20) DEFAULT NULL COMMENT '用户姓名',
  `tel` varchar(11) DEFAULT NULL COMMENT '联系电话',
  `integral` smallint(6) unsigned DEFAULT '10' COMMENT '积分',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP,
  `email` varchar(40) DEFAULT NULL COMMENT '邮箱',
  `recommender_id` int(11) unsigned DEFAULT NULL COMMENT '推荐人id',
  `first_order` tinyint(3) unsigned DEFAULT '0' COMMENT '是否下过单（0：否，1：是）',
  `freezing_integral` smallint(5) unsigned DEFAULT NULL COMMENT '被冻结积分',
  `sign_in` tinyint(3) unsigned DEFAULT '0' COMMENT '是否签到（0:否，1：是）',
  `sign_in_num` smallint(5) unsigned DEFAULT '0' COMMENT '签到天数',
  PRIMARY KEY (`user_id`),
  KEY `openid` (`openid`)
) ENGINE=InnoDB AUTO_INCREMENT=15 DEFAULT CHARSET=utf8 COMMENT='小程序用户信息';

