#
# Event "truncate_note_month"
#

CREATE EVENT `truncate_note_month` ON SCHEDULE EVERY 1 MONTH STARTS '2020-01-01 00:00:00' ON COMPLETION NOT PRESERVE ENABLE COMMENT '每月清除note表' DO delete from note where state = 1;

#
# Event "update_user_day_clear"
#

CREATE EVENT `update_user_day_clear` ON SCHEDULE EVERY 1 DAY STARTS '2020-01-01 00:00:00' ON COMPLETION NOT PRESERVE ENABLE COMMENT '每天凌晨12点把签到状态归为0' DO update user set sign_in=0;
